package whileLoop;

public class Main {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//1' den 10'a kadar olan sayıların karesi
	
		int j = 1;

        while (j <= 10) {
            int karesi = j * j;
            System.out.println(karesi);
            j++;
			
		}
	
	}

}
